import Expendelitem from "./Expenselitem.js";
import "./Expense.css";
import Cards from "../UI/Cards.js";
import React , { useState } from "react";
import ExpenseFilter from "./ExpenseFilter";
const Expense = (props) => {
  // const propsData=[];
  //  props.data.forEach(ele => {
  //   <Expendelitem 
  //   data={ele.data}  title={ele.title} 
  //   amount={ele.amount}></Expendelitem>
  // });
  const [filterYear, setFilterYear] = useState('');
  // console.log(props.data[2].data);
  const selectYear = (year) => {
    setFilterYear(year);
    console.log(filterYear);
  }
  return (
    <div>
    <Cards className='expense'>
      <ExpenseFilter selected={filterYear} 
                 onSelectYear={selectYear}
     />
     {props.data.map( expense => 
     <Expendelitem 
        key= {expense.id}
        title={expense.title} data={expense.data}
        amount={expense.amount} 
        />          
       
         )}
   </Cards>
   </div>
      )
  }
  
export default Expense;
